import React from "react"
import { connect } from "react-redux"


const Welcome = (props) => {

    return (
        <h1>{props.courses}</h1>
    )
}

const mapStateToProps = (state) => {
    return {
        courses: state.courses
    }
}

export default connect(mapStateToProps)(Welcome)
